pragma solidity ^0.4.23;

import "../../external/CloneFactory.sol";
import "../../utility/AddressListFactory.sol";
import "../../utility/TokenCoreFactory.sol";
import "./DelegatedWallet.sol";

contract DelegatedWalletFactory is CloneFactory {
    
    uint public blockCreated;
    
    DelegatedWallet public blueprint;
    AddressListFactory public listFactory;
    TokenCoreFactory public coreFactory;
    
    constructor (
        DelegatedWallet _blueprint,
        AddressListFactory _listFactory,
        TokenCoreFactory _coreFactory
    ) public {
        blockCreated = block.number;

        blueprint = _blueprint;
        listFactory = _listFactory;
        coreFactory = _coreFactory;
    }
    
    function createWallet (address owner, address[] delegateList) public returns (DelegatedWallet) {
        DelegatedWallet wallet = DelegatedWallet(createClone(blueprint));
        AddressList delegates = listFactory.createAddressList(owner, delegateList);
        TokenCore core = coreFactory.createTokenCore(wallet);
        wallet.initialize(owner, delegates, core);
        emit CreateWallet_event(msg.sender, owner, wallet);

        return wallet;
    }
    
    event CreateWallet_event (
        address indexed creator, 
        address indexed owner, 
        address walletAddress
    );
    
}
